import React, { useState, useEffect } from "react"
import Axios from "axios"

import Highcharts from "highcharts/highstock"
import HighchartsReact from "highcharts-react-official"

const Active = () => {
  // const timestampNow = Date.now()
  const [dataChile, setDataChile] = useState([])

  const API_URL = "https://chile-coronapi1.p.rapidapi.com/v3/historical/nation"
  const axiosOptions = {
    headers: {
      "x-rapidapi-host": "chile-coronapi1.p.rapidapi.com",
      "x-rapidapi-key": "5afb9539b2msh32d0d06f16fd204p1e11cdjsn9a53fbf1c1f7",
    },
  }

  useEffect(() => {
    Axios.get(API_URL, axiosOptions)
      .then(data => {
        return data
      })
      .then(data => {
        const dataArr = Object.values(data.data)
        return setDataChile(dataArr)
      })
      .catch(err => {
        return err
      })
  }, [])

  // Tranformed the object the fetch axios have returned by matrix
  // const dataChileReady = Object.values(dataChile)

  const prueba = dataChile.map(o => [new Date(o.day).getTime(), o.confirmed])

  console.log(prueba)

  const [chartOptions, setChartOptions] = useState({
    xAxis: {
      type: "datetime",
    },
    yAxis: {},
    series: [
      {
        type: "line",
        data: [
          dataChile.map(row => {
            return [`${new Date(row.day).getTime()}`, `${row.confirmed}`]
          }),
        ],
      },
    ],
  })

  return (
    <div>
      <HighchartsReact highcharts={Highcharts} options={chartOptions} />
    </div>
  )
}

export default Active
